import PropTypes from 'prop-types';

const AppLayOut = ({childern}) => {
    return (
     <div>
        <div>공통 메뉴</div>
        {childern}
     </div>   
    );
};

AppLayOut.propTypes = {
    childern: PropTypes.node.isRequired,
};

export default AppLayOut;
